import React from "react";
import "../produce/dashboard.css";
import logo from "../../assets/img/logo-choira.svg";

function Dashboard() {
  return (
    <>
      <div className="wrapper">
        <div className="sidebar">
          <div>
            <img src={logo} alt="" />
          </div>
          <div></div>
        </div>
        <div className="dashboard"></div>
      </div>
    </>
  );
}

export default Dashboard;
